    "fort-peck-game-range-refuge-narrative-report-january-february-march-april-1950",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Fort Peck NWR
    and the easement refuges outlines Refuge accomplishments from January through April
    of 1950. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, rodents, mammals, raptors, and fish- is also
    covered. The Refuge development and maintenance section discusses physical developments.
    Resource management is outlined; topics include grazing, fur harvesting, and timber
    removal. The public relations section of the report describes recreational uses,
    Refuge visitors, Refuge participation, and fishing. N-R forms and photographs are
    attached.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
